import React from "react";
import { Container, Row, Col, Card, Button } from "react-bootstrap";
import "./Rooms.css";

const Rooms = () => {
  const roomData = [
    {
      img: "https://res.cloudinary.com/dynx8bauw/image/upload/v1761822641/deluxeRoom_ysyd2x.jpg",
      title: "Standard Room",
      guests: 2,
      size: "250 sq ft",
      desc: "Cozy room perfect for couples with essential amenities and comfortable bedding.",
      price: 1999,
      amenities: ["WiFi", "TV", "AC", "Breakfast"],
    },
    {
      img: "https://res.cloudinary.com/dynx8bauw/image/upload/v1761822642/premiumRoom_uupmcg.jpg",
      title: "Deluxe Room",
      guests: 3,
      size: "350 sq ft",
      desc: "Spacious room with modern amenities and elegant interiors for a comfortable stay.",
      price: 2999,
      amenities: ["WiFi", "TV", "AC", "Mini Bar", "Breakfast"],
    },
    {
      img: "https://res.cloudinary.com/dynx8bauw/image/upload/v1761822642/traditionalRoom_sdbglh.jpg",
      title: "Traditional Suite",
      guests: 3,
      size: "400 sq ft",
      desc: "Experience authentic Banarasi hospitality with traditional decor and modern comforts.",
      price: 3499,
      amenities: ["WiFi", "TV", "AC", "Sitting Area"],
    },
  ];

  return (
    <section>
      {/* Header Section */}
      <div
        className="text-center py-5 text-white"
        style={{ backgroundColor: "#E54C19" }}
      >
        <h2 className="fw-bold">Our Rooms & Suites</h2>
        <p>
          Choose from our range of comfortable and luxurious accommodations.
        </p>
      </div>

      {/* Rooms Section */}
      <Container className="my-5">
        <Row className="g-4">
          {roomData.map((room, index) => (
            <Col md={4} key={index}>
              <Card className="shadow-sm h-100 border-0 rounded-4 overflow-hidden position-relative room-card">
                {/* Image */}
                <div className="position-relative">
                  <Card.Img
                    variant="top"
                    src={room.img}
                    alt={room.title}
                    loading="lazy"
                    style={{ height: "230px", objectFit: "cover" }}
                  />

                  {/* Price Bar */}
                  <div
                    className="position-absolute bottom-0 start-0 w-100 d-flex justify-content-between align-items-center px-3 py-2 price-bar"
                    style={{
                      background: "rgba(0,0,0,0.55)",
                      color: "#fff",
                      backdropFilter: "blur(4px)",
                    }}
                  >
                    <div>
                      <span className="fw-bold fs-5">‚Çπ{room.price}</span>
                      <span className="ms-1" style={{ fontSize: "0.9rem" }}>
                        /night
                      </span>
                    </div>
                    <Button
                      size="sm"
                      variant="light"
                      className="book-now-btn fw-semibold"
                    >
                      Book Now
                    </Button>
                  </div>
                </div>

                {/* Content */}
                <Card.Body>
                  <Card.Title className="mb-2 fw-bold">{room.title}</Card.Title>
                  <p className="text-muted mb-2 small">
                    üë• {room.guests} Guests &nbsp; | &nbsp; üìê {room.size}
                  </p>
                  <p className="text-secondary small mb-3">{room.desc}</p>

                  <p className="fw-semibold mb-2 small">Amenities:</p>
                  <div className="d-flex flex-wrap gap-2">
                    {room.amenities.map((a, i) => (
                      <span
                        key={i}
                        className="badge bg-light text-dark border border-secondary small"
                      >
                        {a}
                      </span>
                    ))}
                  </div>
                </Card.Body>
              </Card>
            </Col>
          ))}
        </Row>
      </Container>

      {/* Scoped Styles for Animation */}
      <style jsx="true">{`
        .book-now-btn {
          color: #e54c19 !important;
          background-color: #fff !important;
          border: none !important;
          padding: 5px 14px;
          border-radius: 8px;
          transition: all 0.3s ease-in-out;
          box-shadow: 0 0 0px rgba(229, 76, 25, 0);
        }

        .book-now-btn:hover {
          background-color: #e54c19 !important;
          color: #fff !important;
          box-shadow: 0 0 12px rgba(229, 76, 25, 0.7);
          transform: translateY(-2px);
        }

        .book-now-btn:active {
          transform: scale(0.97);
        }

        .price-bar {
          transition: all 0.3s ease;
        }

        .room-card:hover .price-bar {
          background: rgba(0, 0, 0, 0.7);
        }
      `}</style>
    </section>
  );
};

export default Rooms;
